DROP TABLE IF EXISTS DPADD_OBJECT;
CREATE TABLE IF NOT EXISTS DPADD_OBJECT (
  ID int(11)  AUTO_INCREMENT, 
  NAME varchar(1000)  , 
  DESCRIPTION varchar(1000)  , 
  TYPE varchar(1000)  , 
  MIN_VALUE varchar(1000)  , 
  MAX_VALUE varchar(1000)  , 
  CURRENT_VALUE varchar(1000)  , 
  VALUES_TYPE varchar(1000)  , 
  STATUS_ID int(11)  DEFAULT -1, 
  RENDERING_ID int(11)  DEFAULT -1, 
  IMAGE_PATH varchar(1000)  , 
  IS_READABLE int(11)  DEFAULT 0, 
  IS_WRITABLE int(11)  DEFAULT 0, 
  IS_VISIBLE int(11)  DEFAULT 0, 
  IS_STOPPABLE int(11)  DEFAULT 0, 
  MSP varchar(1000)  , 
  OPTIONALP varchar(1000)  , 
  PHPCLASS varchar(1000)  , 
  COMMUNICATIONSECTION_ID int(11)  DEFAULT -1, 
  IS_BOOLEAN int(11)  DEFAULT 0, 
  WITH_PERMISSION int(11)  DEFAULT 0, 
  TRACK_FLAG int(11)  DEFAULT 0, 
  IS_REMOTABLE int(11)  DEFAULT 0, 
  REMOTABLE_FILTER varchar(1000)  DEFAULT '\'*\'', 
  OWNED_BY varchar(100)  DEFAULT '\'LOCAL\'', 
  HAS_GRANT int(11)  DEFAULT 0, 
  GRANT_HASHCODE varchar(100)  DEFAULT '\'\'', 
  AUTOMATIC_REFRESH_FLAG int(11)  DEFAULT 0, 
  ENABLE_FLAG tinyint(4)  DEFAULT 1, 
  TRACK_FLAG_ONREAD int(11)  DEFAULT 0, 
  IS_DISCOVERABLE int(11)  DEFAULT 0, 
   PRIMARY KEY (ID),
	KEY (STATUS_ID),
	KEY (RENDERING_ID),
	KEY (COMMUNICATIONSECTION_ID)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS DPADD_OBJECT_RELATION (
  ID int(11)  AUTO_INCREMENT, 
  PARENTOBJ_ID int(11)  , 
  CHILDOBJ_ID int(11)  , 
  RELATION_CONDITION varchar(1000)  , 
  ACTION varchar(1000)  , 
  ACTION_VALUE varchar(1000)  , 
  ORDER_NUM int(11)  DEFAULT 1, 
  ACCESS_MODE varchar(1000)  , 
  CATEGORY_ID varchar(1000)  DEFAULT '\'\'', 
  OPTIONAL varchar(1000)  , 
  STOP_FLAG int(11)  DEFAULT 0, 
  ENABLE_FLAG int(11)  DEFAULT 1, 
  RELATION_WEB_TIPOLOGY varchar(1000)  DEFAULT '\'GENERIC_RELATION\'', 
  OWNED_BY varchar(1000)  DEFAULT '\'LOCAL\'', 
   PRIMARY KEY (ID),
	KEY (PARENTOBJ_ID),
	KEY (CHILDOBJ_ID)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS DPAD_WEB_PHPCLASS (
  ID int(11)  AUTO_INCREMENT, 
  CLASSNAME varchar(1000)  , 
  MODULE varchar(1000)  , 
  INCLUDE_PATH varchar(1000)  , 
  PARENTCLASS varchar(1000)  , 
  NAME varchar(1000)  , 
  IMAGE_PATH varchar(1000)  , 
  VIEWOBJPATH varchar(1000)  , 
  EDITOBJPATH varchar(1000)  , 
  DETAILSOBJPATH varchar(1000)  , 
  IS_VISIBLE int(11)  DEFAULT 1, 
  IS_EXECUTABLE int(11)  DEFAULT 0, 
  IS_EVENT int(11)  DEFAULT 0, 
  IS_COMPLEX int(11)  DEFAULT 0, 
   PRIMARY KEY (ID)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS DPADD_RENDERING (
  ID int(11)  AUTO_INCREMENT, 
  TYPE varchar(1000)  , 
  TIPOLOGY varchar(1000)  , 
  NAME varchar(1000)  DEFAULT '\'\'', 
  HAS_OPTIONS tinyint(4)  DEFAULT 0, 
  MIN_STATE varchar(1000)  , 
  MAX_STATE varchar(1000)  , 
  STEP_STATE varchar(1000)  , 
  IMAGE_PATH varchar(1000)  , 
  OPTION_LABELS varchar(1000)  DEFAULT '\'\'', 
  OPTION_IMAGES varchar(1000)  DEFAULT '\'\'', 
  OPTION_SYMBOLS varchar(1000)  DEFAULT '\'\'', 
  FORMATTING_SCHEMA varchar(1000)  DEFAULT '\'\'', 
  PHPCLASSES varchar(1000)  , 
  VALUES_TYPE varchar(1000)  , 
  IS_VISIBLE int(11)  DEFAULT 1, 
  OWNED_BY varchar(100)  DEFAULT '\'LOCAL\'', 
  OPTION_ACTIONS varchar(1000)  DEFAULT '\'\'', 
  LISTVIEW_SCHEMA varchar(1000)  DEFAULT '\'\'', 
   PRIMARY KEY (ID)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS DPADD_RENDERING_VIEW_PROTOTYPE (
  ID int(11)  AUTO_INCREMENT, 
  RENDERING_ID int(11)  , 
  VIEW varchar(1000)  , 
  PROTOTYPE_ID int(11)  , 
   PRIMARY KEY (ID),
	KEY (RENDERING_ID),
	KEY (PROTOTYPE_ID)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

